         if(currentCharacter == 'a' || currentCharacter == 'A' || currentCharacter == 'e'  || currentCharacter == 'E'|| currentCharacter == 'i' || currentCharacter == 'I' || currentCharacter == 'o' || currentCharacter == 'O' || currentCharacter == 'u' || currentCharacter == 'U')
          {vowelCount++;}
